/* eslint-disable jsx-a11y/iframe-has-title */
import React,{useState,useEffect} from 'react';
import { createMuiTheme, ThemeProvider } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import Style from './Style/Login';
import image from '../Images/background.jpeg'

const theme = createMuiTheme({
    typography: {
      fontSize: 25,
    },
  });


function UserRegistration() {

  const classes = Style();

  const [state, setState] = useState({
                                        firstName:'',
                                        lastName:'',
                                        address:'',
                                        pincode:'',
                                        area:'',
                                        district:'',
                                        state:'',
                                        email:'',
                                        phone:'',
                                        password:''
                                    })

  const handleUserRegistration = (e) => {
      e.preventDefault();
  }

  useEffect(() => {
  return () => {
    console.log("cleaned up");
  };
  }, []);
  return (
      <div>
          <ThemeProvider theme={theme}>
             <React.Fragment>
                <div className={classes.menu}>
                <a className={classes.head} href='/'>
                    <h3 className={classes.mainHead}>Health App</h3>
                </a>
                <div className={classes.subMenu}>
                    <div className={classes.menuItems}>
                        <a href='/' className={classes.logout}>Home</a>
                    </div>
                    <div className={classes.menuItems}>
                        <a href='/login' className={classes.logout}>Login</a>
                    </div>
                </div>
                </div>
                <div className={classes.container}>
                    <div className={classes.loginContainer}>
                    <form required 
                            // error={error}  onSubmit={(e) => { e.preventDefault(); handleSubmit(); } } component="fieldset" className={classes.form}
                             >
                        <TextField
                            variant="outlined"
                            margin="normal"
                            fullWidth
                            id="standard-required"
                            label="First Name"
                            name="firstName"
                            autoComplete="off"
                            // onFocus={()=>{setErrors({...errors,"name":false});
                            // setErrorMessage({...errorMessage,"name":""})}} 
                            // error={errors["name"]}
                            // helperText={errorMessage["name"]}
                            autoFocus
                            value={state.firstName}
                            // onChange={handleInputChange}
                        />
                        <TextField
                            variant="outlined"
                            margin="normal"
                            fullWidth
                            id="standard-required"
                            label="Last Name"
                            name="lastName"
                            autoComplete="off"
                            // onFocus={()=>{setErrors({...errors,"name":false});
                            // setErrorMessage({...errorMessage,"name":""})}} 
                            // error={errors["name"]}
                            // helperText={errorMessage["name"]}
                            value={state.name}
                            // onChange={handleInputChange}
                        />
                        <TextField
                            variant="outlined"
                            margin="normal"
                            fullWidth
                            id="standard-required"
                            label="Address"
                            name="address"
                            autoComplete="off"
                            // onFocus={()=>{setErrors({...errors,"name":false});
                            // setErrorMessage({...errorMessage,"name":""})}} 
                            // error={errors["name"]}
                            // helperText={errorMessage["name"]}
                            value={state.address}
                            // onChange={handleInputChange}
                        />
                        <TextField
                            variant="outlined"
                            margin="normal"
                            fullWidth
                            id="standard-required"
                            label="Pincode"
                            name="pincode"
                            autoComplete="off"
                            // onFocus={()=>{setErrors({...errors,"name":false});
                            // setErrorMessage({...errorMessage,"name":""})}} 
                            // error={errors["name"]}
                            // helperText={errorMessage["name"]}
                            value={state.name}
                            // onChange={handleInputChange}
                        />
                        <TextField
                            variant="outlined"
                            margin="normal"
                            fullWidth
                            id="standard-required"
                            label="Area"
                            name="area"
                            autoComplete="off"
                            // onFocus={()=>{setErrors({...errors,"name":false});
                            // setErrorMessage({...errorMessage,"name":""})}} 
                            // error={errors["name"]}
                            // helperText={errorMessage["name"]}
                            value={state.name}
                            // onChange={handleInputChange}
                        />
                        <TextField
                            variant="outlined"
                            margin="normal"
                            fullWidth
                            id="standard-required"
                            label="District"
                            name="district"
                            autoComplete="off"
                            // onFocus={()=>{setErrors({...errors,"name":false});
                            // setErrorMessage({...errorMessage,"name":""})}} 
                            // error={errors["name"]}
                            // helperText={errorMessage["name"]}
                            // autoFocus
                            // value={state.name}
                            // onChange={handleInputChange}
                        />
                        <TextField
                            variant="outlined"
                            margin="normal"
                            fullWidth
                            id="standard-required"
                            label="State"
                            name="state"
                            autoComplete="off"
                            // onFocus={()=>{setErrors({...errors,"name":false});
                            // setErrorMessage({...errorMessage,"name":""})}} 
                            // error={errors["name"]}
                            // helperText={errorMessage["name"]}
                            // autoFocus
                            // value={state.name}
                            // onChange={handleInputChange}
                        />
                        <TextField
                            variant="outlined"
                            margin="normal"
                            fullWidth
                            id="standard-required"
                            label="Email"
                            name="email"
                            autoComplete="off"
                            // onFocus={()=>{setErrors({...errors,"name":false});
                            // setErrorMessage({...errorMessage,"name":""})}} 
                            // error={errors["name"]}
                            // helperText={errorMessage["name"]}
                            // autoFocus
                            // value={state.name}
                            // onChange={handleInputChange}
                        />
                        <TextField
                            variant="outlined"
                            margin="normal"
                            fullWidth
                            id="standard-required"
                            label="Phone Number"
                            name="phone"
                            autoComplete="off"
                            // onFocus={()=>{setErrors({...errors,"name":false});
                            // setErrorMessage({...errorMessage,"name":""})}} 
                            // error={errors["name"]}
                            // helperText={errorMessage["name"]}
                            // autoFocus
                            // value={state.name}
                            // onChange={handleInputChange}
                        />
                        <TextField
                            variant="outlined"
                            margin="normal"
                            fullWidth
                            id="standard-required"
                            label="Password"
                            name="password"
                            autoComplete="off"
                            type="password"
                            // onFocus={()=>{setErrors({...errors,"name":false});
                            // setErrorMessage({...errorMessage,"name":""})}} 
                            // error={errors["name"]}
                            // helperText={errorMessage["name"]}
                            // autoFocus
                            // value={state.name}
                            // onChange={handleInputChange}
                        />
                        <div className={classes.formButton}>  
                            <Button
                                type="submit"
                                variant="contained"
                                color="red"
                                // disabled={stateLoading || stageLoading}
                                fullWidth
                                id='submit'
                                className={classes.submit}
                            >
                                Register
                            </Button>
                        </div>
                        </form>
                    </div>
                    <div className={classes.sideImage}>
                        <h2>Register</h2>
                        <img src={image} width="100%" height="100%" style={{borderRadius:'1rem',objectFit:'cover'}}/>
                    </div>
                </div>
             </React.Fragment>
          </ThemeProvider>
      </div>
    );
}
export default UserRegistration;
